  true,\n\t\"url\": null,\n\t\"notes\": \"The NHTSA Product Information Catalog and
  Vehicle Listing (vPIC) is a consolidated platform that presents data collected within
  the manufacturer reported data from CFR 49 Parts 551 - 574 for use in a variety
  of modern tools. NHTSA's vPIC platform is intended to serve as a centralized source
  for basic Vehicle Identification Number (VIN) decoding, Manufacturer Information
  Database (MID), Manufacturer Equipment Plant Identification and associated data.
  vPIC is intended to support the Open Data and Transparency initiatives of the agency
  by allowing the data to be freely used by the public without the burden of manual
  retrieval from a library of electronic documents (PDFs). While these documents will
  still be available online for viewing within the Manufacturer Information Database
  (MID) module of vPIC one can view and use the actual data through the VIN Decoder
  and Application Programming Interface (API) modules.\",\n\t\"license_title\": \"Other
